A config object containing one or more event handlers to be added to this object during initialization. This
should be a valid listeners config object as specified in the
<a href='#!/api/Ext.util.Observable-method-addListener'>Ext.util.Observable#addListener</a> example for attaching
multiple handlers at once.

**DOM events from Ext JS <a href='#!/api/Ext.Component'>Ext.Component</a>**

While _some_ Ext JS Component classes export selected DOM events (e.g. "click", "mouseover" etc), this is usually
only done when extra value can be added. For example the <a href='#!/api/Ext.view.View'>Ext.view.View</a>s **<a href='#!/api/Ext.view.View-event-itemclick'>Ext.view.View#itemclick</a>** event passing the node clicked on. To access DOM events directly from a
child element of a Component, we need to specify the `element` option to identify the Component property to add a
DOM listener to:

    new Ext.panel.Panel({
        width: 400,
        height: 200,
        dockedItems: [{
            xtype: 'toolbar'
        }],
        listeners: {
            click: {
                element: 'el', //bind to the underlying el property on the panel
                fn: function(){ console.log('click el'); }
            },
            dblclick: {
                element: 'body', //bind to the underlying body property on the panel
                fn: function(){ console.log('dblclick body'); }
            }
        }
    });

The name of the property which contains a response message for exception handling. If you want to return a false success
response from the server, maybe due to some server-side validation, the messageProperty can hold the error message. For
example:

    {
        "success": false,
        "error": "There was an error with your request"
    }

You can retrieve this error message in a callback when loading a <a href='#!/api/Ext.data.Store'>Ext.data.Store</a> or <a href='#!/api/Ext.data.Model'>Ext.data.Model</a> like:

    var store = new Ext.data.Store({
        fields : ['foo'],
        proxy  : {
            type   : 'ajax',
            url    : 'data.json',
            reader : {
                type            : 'json',
                rootProperty    : 'data',
                messageProperty : 'error'
            }
        }
    });

    store.load({
        callback: function(records, operation, success) {
            if (success) {
                // ...
            } else {
                var error = operation.getError();

                Ext.Msg.alert('Error', error);
            }
        }
    });

In this example, the callback will execute with `success` being `false` and will therefore show the <a href='#!/api/Ext.MessageBox-method-alert'>Ext.MessageBox#alert</a> with
the error string returned in the response.

The property that contains data items corresponding to the
Model(s) of the configured Reader. <a href='#!/api/Ext.data.soap.Reader-cfg-rootProperty'>rootProperty</a> varies by Reader type.

##JSON Reader
<a href='#!/api/Ext.data.soap.Reader-cfg-rootProperty'>rootProperty</a> is a property name. It may also be a dot-separated
list of property names if the root is nested. The root JSON array will be
used by default.

    // rootPropety config
    rootProperty: 'embedded.myresults'

    // server response
    {
        embedded: {
            myresults: [{
                name: 'Scott',
                age: 22
            }, {
                name: 'Ramona',
                age: 24
            }]
        },
        success: true
    }

##XML Reader
<a href='#!/api/Ext.data.soap.Reader-cfg-rootProperty'>rootProperty</a> is a CSS selector. The root XML element will be used
by default.

    // rootProperty config (plus record config)
    rootProperty: 'myresults',
    record: 'user'

    // server response
    <?xml version="1.0" encoding="UTF-8"?>
    <embedded>
        <myresults>
            <user>
                <name>Scott</name>
                <age>22</age>
            </user>
            <user>
                <name>Ramona</name>
                <age>24</age>
            </user>
        </myresults>
    </embedded>

##Array Reader
<a href='#!/api/Ext.data.soap.Reader-cfg-rootProperty'>rootProperty</a> is not typically applicable since the data is assumed to be a
single-level array of arrays.  However, if the array of records is returned
within a JSON response a <a href='#!/api/Ext.data.soap.Reader-cfg-rootProperty'>rootProperty</a> config may be used:

    // rootProperty config
    rootProperty: 'embedded.myresults'

    // server response
    {
        embedded: {
            myresults: [['Scott', 22], ['Ramona', 24]]
        },
        success: true
    }

##rootProperty as a function
The <a href='#!/api/Ext.data.soap.Reader-cfg-rootProperty'>rootProperty</a> may also be a function that returns the root node from
the dataset. For example:

    var store = Ext.create('Ext.data.TreeStore', {
        proxy: {
            type: 'memory',
            reader: {
                type: 'json',
                rootProperty: function(data){
                    // Extract child nodes from the items or children property in the dataset
                    return data.items || data.children;
                }
            }
        },
        data: {
            items: [{
                text: 'item 1',
                children: [{
                    text: 'child A',
                    leaf: true
                }]
            }]
        }
    });

    Ext.create('Ext.tree.Panel', {
        title: 'rootProperty as a function',
        width: 200,
        height:150,
        store: store,
        rootVisible: false,
        renderTo: Ext.getBody()
    });

If a transform function is set, it will be invoked just before <a href='#!/api/Ext.data.soap.Reader-method-readRecords'>readRecords</a> executes.
It is passed the raw (deserialized) data object. The transform function returns a data object, which can be
a modified version of the original data object, or a completely new data object. The transform can
be a function, or a method name on the Reader instance, or an object with a 'fn' key
and an optional 'scope' key.

Example usage:

    Ext.create('Ext.data.Store', {
        model: 'User',
        proxy: {
            type: 'ajax',
            url : 'users.json',
            reader: {
                type: 'json',
                transform: {
                    fn: function(data) {
                        // do some manipulation of the raw data object
                        return data;
                    },
                    scope: this
                }
            }
        },
    });

The name of the property in a node raw data block which indicates the type of the model to be created from that raw data. Useful for heterogeneous trees.

For example, hierarchical geographical data may look like this:

    {
        nodeType: 'Territory',
        name: 'EMEA',
        children: [{
            nodeType: 'Country',
            name: 'United Kingdon',
            children: [{
                nodeType: 'City',
                name: 'London'
            }]
        }]
    }

You would configure the typeProperty in this case to be `"nodeType"` which would cause the models named "Territory", "Country" and "City" to
be used.

The <a href='#!/api/Ext.data.soap.Reader-method-on'>on</a> method is shorthand for
<a href='#!/api/Ext.util.Observable-method-addListener'>Ext.util.Observable#addListener</a>.

Appends an event handler to this object.  For example:

    myGridPanel.on("itemclick", this.onItemClick, this);

The method also allows for a single argument to be passed which is a config object
containing properties which specify multiple events. For example:

    myGridPanel.on({
        cellclick: this.onCellClick,
        select: this.onSelect,
        viewready: this.onViewReady,
        scope: this // Important. Ensure "this" is correct during handler execution
    });

One can also specify options for each event handler separately:

    myGridPanel.on({
        cellclick: {fn: this.onCellClick, scope: this, single: true},
        viewready: {fn: panel.onViewReady, scope: panel}
    });

*Names* of methods in a specified scope may also be used:

    myGridPanel.on({
        cellclick: {fn: 'onCellClick', scope: this, single: true},
        viewready: {fn: 'onViewReady', scope: panel}
    });

  A shortcut for the `order` event option.  Provided for backward compatibility.
  Please use the `priority` event option instead.

**Combining Options**

Using the options argument, it is possible to combine different types of listeners:

A delayed, one-time listener.

    myPanel.on('hide', this.handleClick, this, {
        single: true,
        delay: 100
    });

**Attaching multiple handlers in 1 call**

The method also allows for a single argument to be passed which is a config object
containing properties which specify multiple handlers and handler configs.

    grid.on({
        itemclick: 'onItemClick',
        itemcontextmenu: grid.onItemContextmenu,
        destroy: {
            fn: function () {
                // function called within the 'altCmp' scope instead of grid
            },
            scope: altCmp // unique scope for the destroy handler
        },
        scope: grid       // default scope - provided for example clarity
    });

**Delegate**

This is a configuration option that you can pass along when registering a handler for
an event to assist with event delegation. By setting this configuration option
to a simple selector, the target element will be filtered to look for a
descendant of the target. For example:

    var panel = Ext.create({
        xtype: 'panel',
        renderTo: document.body,
        title: 'Delegate Handler Example',
        frame: true,
        height: 220,
        width: 220,
        html: '<h1 class="myTitle">BODY TITLE</h1>Body content'
    });

    // The click handler will only be called when the click occurs on the
    // delegate: h1.myTitle ("h1" tag with class "myTitle")
    panel.on({
        click: function (e) {
            console.log(e.getTarget().innerHTML);
        },
        element: 'body',
        delegate: 'h1.myTitle'
     });

**Only when the `destroyable` option is specified. **

 A `Destroyable` object. An object which implements the `destroy` method which removes
 all listeners added in this call. For example:

    this.btnListeners =  = myButton.on({
        destroyable: true
        mouseover:   function() { console.log('mouseover'); },
        mouseout:    function() { console.log('mouseout'); },
        click:       function() { console.log('click'); }
    });

And when those listeners need to be removed:

    Ext.destroy(this.btnListeners);

or

    this.btnListeners.destroy();

The addManagedListener method is used when some object (call it "A") is listening
to an event on another observable object ("B") and you want to remove that listener
from "B" when "A" is destroyed. This is not an issue when "B" is destroyed because
all of its listeners will be removed at that time.

Example:

    Ext.define('Foo', {
        extend: 'Ext.Component',

        initComponent: function () {
            this.addManagedListener(MyApp.SomeGlobalSharedMenu, 'show', this.doSomething);
            this.callParent();
        }
    });

As you can see, when an instance of Foo is destroyed, it ensures that the 'show'
listener on the menu (`MyApp.SomeGlobalSharedMenu`) is also removed.

As of version 5.1 it is no longer necessary to use this method in most cases because
listeners are automatically managed if the scope object provided to
<a href='#!/api/Ext.util.Observable-method-addListener'>Ext.util.Observable#addListener</a> is an Observable instance.
However, if the observable instance and scope are not the same object you
still need to use <a href='#!/api/Ext.data.soap.Reader-method-mon'>mon</a> or <a href='#!/api/Ext.data.soap.Reader-method-addManagedListener'>addManagedListener</a> if you want the listener to be
managed.

**Only when the `destroyable` option is specified. **

 A `Destroyable` object. An object which implements the `destroy` method which removes all listeners added in this call. For example:

    this.btnListeners = myButton.mon({
        destroyable: true
        mouseover:   function() { console.log('mouseover'); },
        mouseout:    function() { console.log('mouseout'); },
        click:       function() { console.log('click'); }
    });

And when those listeners need to be removed:

    Ext.destroy(this.btnListeners);

or

    this.btnListeners.destroy();

Enables events fired by this Observable to bubble up an owner hierarchy by calling `this.getBubbleTarget()` if
present. There is no implementation in the Observable base class.

This is commonly used by Ext.Components to bubble events to owner Containers.
See <a href='#!/api/Ext.Component-method-getBubbleTarget'>Ext.Component#getBubbleTarget</a>. The default implementation in Ext.Component returns the
Component's immediate owner. But if a known target is required, this can be overridden to access the
required target more quickly.

Example:

    Ext.define('Ext.overrides.form.field.Base', {
        override: 'Ext.form.field.Base',

        //  Add functionality to Field's initComponent to enable the change event to bubble
        initComponent: function () {
            this.callParent();
            this.enableBubble('change');
        }
    });

    var myForm = Ext.create('Ext.form.Panel', {
        title: 'User Details',
        items: [{
            ...
        }],
        listeners: {
            change: function() {
                // Title goes red if form has been modified.
                myForm.header.setStyle('color', 'red');
            }
        }
    });

A common prefix to prepend to the event names. For example:

    this.relayEvents(this.getStore(), ['load', 'clear'], 'store');

Now the grid will forward 'load' and 'clear' events of store as 'storeload' and 'storeclear'.

A `Destroyable` object. An object which implements the `destroy` method which, when destroyed, removes all relayers. For example:

    this.storeRelayers = this.relayEvents(this.getStore(), ['load', 'clear'], 'store');

Can be undone by calling

    Ext.destroy(this.storeRelayers);

or
    this.store.relayers.destroy();

(optional) The scope originally specified for the handler. It
must be the same as the scope argument specified in the original call to
<a href='#!/api/Ext.util.Observable-method-addListener'>Ext.util.Observable#addListener</a> or the listener will not be removed.

**Convenience Syntax**

You can use the <a href='#!/api/Ext.util.Observable-method-addListener'>Ext.util.Observable#addListener</a>
`destroyable: true` config option in place of calling un().  For example:

    var listeners = cmp.on({
        scope: cmp,
        afterrender: cmp.onAfterrender,
        beforehide: cmp.onBeforeHide,
        destroyable: true
    });

    // Remove listeners
    listeners.destroy();
    // or
    cmp.un(
        scope: cmp,
        afterrender: cmp.onAfterrender,
        beforehide: cmp.onBeforeHide
    );

**Exception - DOM event handlers using the element config option**

You must go directly through the element to detach an event handler attached using
the <a href='#!/api/Ext.util.Observable-method-addListener'>Ext.util.Observable#addListener</a> _element_ option.

    panel.on({
        element: 'body',
        click: 'onBodyCLick'
    });

    panel.body.un({
        click: 'onBodyCLick'
    });
